"use strict";

$(document).ready(function () {
  document.getElementById("contenedorletrap").innerHTML = "\n    <div class=\"divfooter2 center-align\"><span class=\"inicial--productos Tipografia--general\"><b>All</b></span></div><br><br><br></div>\n    ";
  document.getElementById("contenedorliteral").innerHTML = "\n    \n    <div class=\"row\" style=\"margin-top:-30px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/PESCADO_270623.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_acidos_grasos\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Acidos Grasos</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Los \xE1cidos grasos se derivan de grasas y aceites animales como el sebo de res y de aceites vegetales tales como aceite de soja, aceite de colza, aceite de coco y de palmiste, aceite de palma aceite, entre otros.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Chemical Broker ofrece una amplia gama de \xC1cidos Grasos de cadena corta, cadena media y cadena larga. Nuestras relaciones de negocios con nuestros fabricantes en America, Europa y Asia brindan capacidad de respuesta y garant\xEDa de suministro en todo el mundo.\n    <p class=\"Tipografia--general Botones letranegro Leeracidgrass\"><b><a href=\"Acidos_grasos.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n \n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/ALCOHOLES-GRASOS_IMAGEN-1.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_acidos_grasos\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Alcoholes Grasos</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Chemical Broker ofrece una amplia gama de Alcoholes Grasos de fracci\xF3n media y fracci\xF3n pesada a partir de materias primas naturales sostenibles. </p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Nuestras relaciones de negocios con nuestros fabricantes en America, Europa y Asia brindan capacidad de respuesta y garant\xEDa de suministro en todo el mundo.\n    <p class=\"Tipografia--general Botones letranegro Leeralcoholesgrasos\"><b><a href=\"Alcoholes_Grasos.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/CB_ALCOHOL_ISOPROPILICO.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_acidos_grasos\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Alcohol Isopropilico</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El Alcohol Isopropilico (propan-2-ol, Isopropanol o 2-propanol), es un compuesto org\xE1nico incoloro e inflamable con un olor a alcohol acre.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Se utiliza en la fabricaci\xF3n de una amplia variedad de productos qu\xEDmicos industriales y dom\xE9sticos y es un ingrediente com\xFAn en productos como antis\xE9pticos, desinfectantes y detergentes.\n    <p class=\"Tipografia--general Botones letranegro LeeralcoholIsopropilico\"><b><a href=\"Alcohol_Isopropilico.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n    <div class=\"row\" style=\"margin-top:150px;\">\n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/ANTIOXIDANTES_020823.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class=\"col s12 m12 l6 xl6 columnas_antioxidantes\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Antioxidantes</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Los Antioxidantes son mol\xE9culas capaces de retardar o prevenir la oxidaci\xF3n de otras mol\xE9culas y alargar la vida \xFAtil de los productos.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Los antioxidantes son muy importantes para la industria alimentaria humana y animal, as\xED como para la industria farmac\xE9utica, veterinaria y cosm\xE9tica ya que logran que los productos conserven sus propiedades y sus niveles de calidad.</p>\n    <p class=\"Tipografia--general Botones letranegro Leerantiox\"><b><a href=\"Antioxidantes.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </p>\n    </div>\n    </div>\n\n\n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/CB_BICARBONATO_SODIO_271222.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_bicarbonato_sodio\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Bicarbonato de Sodio</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El Bicarbonato de Sodio es un compuesto s\xF3lido cristalino de color blanco soluble en agua, con un ligero sabor alcalino parecido al del carbonato de sodio (menos fuerte y m\xE1s salado) Se puede encontrar como mineral en la naturaleza o se puede producir artificialmente.  La forma mineral natural es nahcolita. Es un componente del mineral natr\xF3n y se encuentra disuelto en muchos manantiales minerales.</p>\n    <p class=\"Tipografia--general Botones letranegro LeerBicarSodio\"><b><a href=\"Bicarbonato_Sodio.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n\n    <div class=\"row\" style=\"margin-top:150px;\">\n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/CB_COLLAGEN_280723.jpg\" alt=\"Col\xE1geno Hidrolizado\" style=\"width:100%;border-radius:10px\">\n    </div>\n    <div class=\"col s12 m12 l6 xl6 columnas_dextrosas\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Col\xE1geno Hidrolizado</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Es un producto proteico natural, obtenido por hidr\xF3lisis enzim\xE1tica de material rico en col\xE1geno de origen bovino. Tiene un olor y sabor muy neutro y es adecuado para aplicaciones de mezclas de polvo seco, bebidas, barras, galletas y chicles.</p>\n    <p class=\"Tipografia--general Botones letranegro LeerColageno\"><b><a href=\"Colageno_Hidrolizado.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n    <div class=\"row\" style=\"margin-top:70px;display:none\">\n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/Acidos.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class=\"col s12 m12 l6 xl6 columnas_acidulantes\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Acidulantes</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\"> Los acidulantes son sustancias activas que modifican la acidez de los alimentos y ayudan a reforzar su sabor</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\"> Los acidulantes tambien cumplen funciones de aromatizacion, son antioxidantes y aumentan la vida util de los alimentos para evitar la oxidacion en las sustancias eseciales que confieren las propiedades organolepticas al producto.</p>\n    <p class=\"Tipografia--general Botones letranegro Leerantiox\"><b><a href=\"Acidulantes.php\" style=\"color:#212637;\" class=\"Botones arrowblue\"> Leer Mas...</a></b></p>\n    </p>\n    </div>\n    </div>\n\n\n\n\n\n    \n    <div class=\"row\" style=\"margin-top:150px;display:none\">\n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/CB_DEXTROSAS_130323.jpg\" alt=\"Dextrosas\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class=\"col s12 m12 l6 xl6 columnas_gomas\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Gomas</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">La dextrosa es un az\xFAcar simple, qu\xEDmicamente id\xE9ntico a la glucosa, que proporciona 4 kcal por gramo y tiene varios usos, desde el culinario, la elaboraci\xF3n de productos procesados de mano de la industria alimentaria, hasta el medicinal y el deportivo.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\"> Es indispensable para el buen funcionamiento del organismo, pues proporciona nutrici\xF3n a las c\xE9lulas para que transforme el az\xFAcar en energ\xEDa. Sin embargo, dado que es un az\xFAcar simple, un uso indebido o excesivo puede provocar serios problemas de salud, sobre todo a largo plazo</p>\n    <p class=\"Tipografia--general Botones letranegro Leersorbi\"><b><a href=\"Dextrosas.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n    \n    <div class=\"row\" style=\"margin-top:70px;display:none\">\n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"\" alt=\"\" style=\"width:100%\">\n    </div>\n    <div class=\"col s12 m12 l6 xl6 columnas_carbomeros\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Carbomeros</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Los carbomeros son pol\xEDmeros sint\xE9ticos hidrof\xEDlicos de \xE1cido acr\xEDlico. En cosm\xE9tica, se usan para espesar las preparaciones como agente gelificante y emulsionante, pero tambi\xE9n como solvente para ayudar a que las f\xF3rmulas se mantengan bien mezcladas. Estas son mol\xE9culas grandes que no penetran las barreras de la piel.</p>\n    <p class=\"Tipografia--general Botones letranegro Leerantiox\"><b><a href=\"Carbomeros.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n    \n    \n    <div class=\"row\" style=\"margin-top:150px;\">\n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/CB_DEXTROSAS_130323.jpg\" alt=\"Dextrosas\" style=\"width:100%;border-radius:10px\">\n    </div>\n    <div class=\"col s12 m12 l6 xl6 columnas_dextrosas\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Dextrosa</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">La Dextrosa es un az\xFAcar que se encuentra ampliamente en la naturaleza, por ejemplo, en la miel y muchas frutas. Como componente de la celulosa, el almid\xF3n y el gluc\xF3geno, se encuentra en todas las plantas y animales y tambi\xE9n se conoce como \"az\xFAcar de uva\" o \"az\xFAcar en la sangre\".</p>\n    <p class=\"Tipografia--general Botones letranegro LeerDextrosa\"><b><a href=\"Dextrosas.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n\n   \n    \n    \n    <div class=\"row\" style=\"margin-top:70px;display:none\">\n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"\" alt=\"\" style=\"width:100%\">\n    </div>\n    <div class=\"col s12 m12 l6 xl6 columnas_edta\">\n    <h5 class=\"Tipografia--general Titulos\"><b>EDTA\xB4s</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El \xE1cido etilendiaminotetraac\xE9tico, tambi\xE9n denominado EDTA o con menor frecuencia AEDT, es una sustancia utilizada como agente quelante que puede crear complejos con un metal que tenga una estructura de coordinaci\xF3n octa\xE9drica. Coordina a metales pesados de forma reversible por cuatro posiciones acetato y dos amino, lo que lo convierte en un ligando hexadentado, y el m\xE1s importante de los ligandos quelatos. Fue sintetizado por primera vez en 1935 por Ferdinand M\xFCnz. </p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El EDTA y sus derivados tienen la valiosa propiedad qu\xEDmica de combinarse con iones met\xE1licos polivalentes en soluci\xF3n para formar complejos coordinados c\xEDclicos no i\xF3nicos, solubles en agua y virtualmente no disociables. A estos complejos se les conoce como quelatos.</p>\n    <p class=\"Tipografia--general Botones letranegro Leerantiox\"><b><a href=\"Carbomeros.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n    \n    \n    <div class=\"row\" style=\"margin-top:150px;\"> \n    <div class = \"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/CB_GLICERINAS_030823.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_glicerinas\">\n    <h5 class=\"Titulos Tipografia--general\"><b>Glicerinas</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Chemical Broker distribuye mundialmente Glicerina de la mas alta Pureza y Calidad para las formulaciones de nuestros clientes.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Hoy en dia nuestra oferta incluye glicerina en cumplimiento a GMP\xB4s, Kosher, Halal, GFSI, FCC, USP, RSPO Mass Balance. \n    <p class=\"Tipografia--general General--Cuerpo letranegro Leerglice\"><b><a href=\"Glycerins.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </p>\n    </div>\n    </div>\n    \n    \n    <div class=\"row\" style=\"margin-top:150px\">\n    <div class=\"col s12 m12 l6 xl16 center-align\">\n    <img src=\"img/CB_GLICOLS_070323.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class=\"col s12 m12 l6 xl6 columnas_glicoles\">\n    <h5 class=\"Titulos Tipografia--general\"><b>Glicoles</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Los Glicoles son un tipo de compuestos l\xEDquidos densos con sabor dulce y acre, son compuestos qu\xEDmicos org\xE1nicos creados a partir de una estructura de hidrocarburo alif\xE1tico y dos grupos hidroxilo; grupos -OH) que resultan de la reacci\xF3n del agua con el \xF3xido de etileno.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Todos los glicoles se presentan en forma de l\xEDquido claro, transparente, inodoro y de baja volatilidad. Los glicoles de poco peso molecular son totalmente miscibles en agua y la mayor\xEDa cuentan con una gran capacidad para disolverse en casi todos los compuestos org\xE1nicos.</p>\n    <p class=\"Tipografia--general Botones Leergli\"><b><a href=\"Glycols.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n\n    <div class=\"row\" style=\"margin-top:150px\">\n    <div class=\"col s12 m12 l6 xl16 center-align\">\n    <img src=\"img/CB_JARABE_MAIZ_270223.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class=\"col s12 m12 l6 xl6 columnas_jarabe_maiz\">\n    <h5 class=\"Titulos Tipografia--general\"><b>Jarabe de Ma\xEDz</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El jarabe de ma\xEDz es un edulcorante l\xEDquido, creado a partir del almid\xF3n o f\xE9cula de ma\xEDz.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Con un rango de jarabes carb\xF3n-refinados, desmineralizados y de conversi\xF3n enzim\xE1tica los ingredientes <span style=\"color:orange\">Clearsweet\xAE</span> Jarabes de Ma\xEDz y <span style=\"color:green\">Cleardex\xAE</span> Jarabe de Ma\xEDz pueden ayudar a alcanzar la textura justa y sabor caracter\xEDstico de sus requerimientos </p>\n    <p class=\"Tipografia--general Botones Leermaiz\" ><b><a href=\"Jarabe_Maiz.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n    \n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class = \"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/LAURIL-SULFATO-SODIO-94_PICTURE_1_V2.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_lauril_sulfato\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Lauril Sulfato de Sodio 94%</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El Lauril Sulfato de Sodio 94% es un alquilsulfato en forma de polvo. El producto pertenece a los tensoactivos de naturaleza ani\xF3nica con un alto contenido en sustancia activa de al menos el 94%.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Es un surfactante anionico con alto poder detergente, espumante y humectante. Las caracter\xEDsticas principales de este producto incluyen una excelente capacidad de emulsi\xF3n, humectabilidad y, lo que es m\xE1s importante, fuertes propiedades de formaci\xF3n de espuma: este producto produce una espuma alta y muy estable.</p>\n    <p class=\"Tipografia--general Botones Leerlauril\" ><b><a href=\"Lauril_Sulfato_Sodio-94.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n    \n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class = \"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/LECITINAS_4.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_lecitinas\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Lecitinas</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">La lecitina es una sustancia organica abundante en las membranas de las celulas vegetales y animales, especialmente en las del tejido nervioso; se obtiene de las grasas animales, la yema de huevo, algunas semillas y se emplea en la elaboracion de ciertos alimentos, como la margarina o el chocolate tambien se aplica en otras industrias como farmaceutica y cosmetica. </p>\n    <p class=\"Tipografia--general Botones Leerleci\"><b><a href=\"Lecitinas.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class = \"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/CB_POPSTART_MALTODEXTRINA_080323.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_maltodextrina\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Maltrodextrina</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">La Maltodextrina es una mezcla de pol\xEDmeros de glucosa que aparecen como resultado de la hidrolisis del almid\xF3n. </p>\n    <p class=\"Tipografia--general Botones Leermaltodextrin\"><b><a href=\"Maltodextrina.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/CB_METIL_130223.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_dimetilformamida\">\n    <h5 class=\"Tipografia--general Titulos\"><b>N, N-Dimetilformamida</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">La N, N-Dimetilformamida (Dimetilformamida), comunmente abreviado como DMF, es un compuesto organico, es un liquido incoloro miscible en aguay en la mayoria de componentes organicos.</p>\n    <p class=\"Tipografia--general Botones letranegro LeerDimetil\"><b><a href=\"Dimetilformamida.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/NITRURO-BORO-FOTO.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_nitruro_boro\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Nitruro de Boro</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El Nitruro de Boro Momentive Softouch es un polvo de grado cosm\xE9tico muy fino con buena opacidad. Puede impartir una sensaci\xF3n sedosa, suave y l\xFAbricante en las formulaciones cosm\xE9ticas, al tiempo que mejora la difusi\xF3n.</p>\n    <p class=\"Tipografia--general Botones letranegro Leernitruro\"><b><a href=\"Nitruro_Boro.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/N-METHYL_081122.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_metilpirrolidona\">\n    <h5 class=\"Tipografia--general Titulos\"><b>N-Metilpirrolidona</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">La N-Metilpirrolidona es un disolvente organico aprotico altamente polar con un contenido reducido de aminas libres y un bajo contenido de agua, se utiliza principalmente en la industria farmaceutica en la sistensis de p\xE9ptidos y para que los fabricantes de membranas proporcionen altos rendimientos, alta eficiencia y mayores tasas de reciclaje que los grados convencionales.</p>\n    <p class=\"Tipografia--general Botones letranegro LeerNMETHYL\"><b><a href=\"N-Metilpirrolidona.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n    \n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/CB_PASTA_SOYA_280223.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_pasta_soya\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Pasta de Soya</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">La Pasta de Soya es la fuente de prote\xEDna m\xE1s importante utilizada en la alimentaci\xF3n humana y del ganado. La pasta de soya es la fuente natural m\xE1s concentrada de prote\xEDna, amino\xE1cidos y energ\xEDa. Debido a esto en la actualidad es el ingrediente m\xE1s utilizado por nutri\xF3logos en la elaboraci\xF3n de alimentos balanceados para cualquier tipo de animal.</p>\n    <p class=\"Tipografia--general Botones letranegro LeerPasta\"><b><a href=\"Pasta_Soya.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/MANZANA_VERDE_141222.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_pectinas\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Pectinas</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Las Pectinas son una mezcla de polimeros acidos y neutros muy ramificados.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Las pectinas son hidrocoloides solubles en agua con funciones gelificantes y espesantes.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">Las pectinas tambien proporcionan superficies cargadas que regulan el pH y el balance ionico.</p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">La Pectina contiene principalmente acidos galacturonicosparcialmente metoxilados. La pectina, un ingrediente vers\xE1til para texturas innovadoras La pectina es un ingrediente y un componente natural de las plantas. La pectina se encuentra en muchas frutas, pero es especialmente abundante en las manzanas y los c\xEDtricos. La pectina de la fruta est\xE1 asociada a la celulosa en los tejidos vegetales, donde juega un papel fundamental en la determinaci\xF3n de sus propiedades mec\xE1nicas.</p>\n    <p class=\"Tipografia--general Botones letranegro Leerpectina\"><b><a href=\"Pectinas.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n    \n    <div class=\"row\" style=\"margin-top:150px\"> \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    <img src=\"img/pasta-dientes-fluor.jpg\" alt=\"\" style=\"width:100%;border-radius:10px;\" class=\"zoom\">\n    </div>\n    <div class= \"col s12 m12 l6 xl6 columnas_sorbitoles\">\n    <h5 class=\"Tipografia--general Titulos\"><b>Sorbitoles</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El sorbitol es un polialcohol, alcohol polihidrico alditol de azucar, industrialmente se obtiene por reduccion mediante hidrogenacion catal\xEDtica del monosac\xE1rido mas comun, \u201Cla glucosa\u201D. </p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">En la naturaleza el sorbitol es uno de los tres glucidos (sacarosa, almidon y sorbitol), principales producidos por la fotosintesis en las hojas adultas de ciertas plantas de la familia Rosaceae y Plantaginaceae, se ecuentran en cantidades apreciables en algas rojas, peras, manzanas, cerezas, duraznos.</p>\n    <p class=\"Tipografia--general Botones letranegro Leersorbi\"><b><a href=\"Sorbitoles.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n\n\n    ";
});

