  document.getElementById("contenedorliteral").innerHTML = "\n    \n    <div class=\"row\" style=\"margin-top:70px;display:none\">\n    \n    <div class=\"col s12 m12 l6 xl6 center-align\">\n    \n    <img src=\"\" alt=\"\" style=\"width:100%\">\n    </div>\n    \n    <div class=\"col s12 m12 l6 xl6\" style=\"margin-top:-32px\">\n    <h5 class=\"Tipografia--general Titulos\"><b>EDTA\xB4s</b></h5>\n    <hr style=\"border:1px solid #b21b27\">\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El \xE1cido etilendiaminotetraac\xE9tico, tambi\xE9n denominado EDTA o con menor frecuencia AEDT, es una sustancia utilizada como agente quelante que puede crear complejos con un metal que tenga una estructura de coordinaci\xF3n octa\xE9drica. Coordina a metales pesados de forma reversible por cuatro posiciones acetato y dos amino, lo que lo convierte en un ligando hexadentado, y el m\xE1s importante de los ligandos quelatos. Fue sintetizado por primera vez en 1935 por Ferdinand M\xFCnz. </p>\n    <p class=\"Tipografia--general General--Cuerpo letranegro\">El EDTA y sus derivados tienen la valiosa propiedad qu\xEDmica de combinarse con iones met\xE1licos polivalentes en soluci\xF3n para formar complejos coordinados c\xEDclicos no i\xF3nicos, solubles en agua y virtualmente no disociables. A estos complejos se les conoce como quelatos.</p>\n    <p class=\"Tipografia--general Botones letranegro Leerantiox\"><b><a href=\"Carbomeros.php\" style=\"color:#212637;\" class=\"Botones arrowblue\">Leer Mas...</a></b></p>\n    </div>\n    </div>\n    ";
